  We are setting up the first meet up as a collaboration between Facebook Developer Circle community in Cairo and Egyptian Geeks community (this awesome community)

  26th of August in Greek Campus.

  An event page is in the making, more details to be revealed very soon but I could not wait more to share this exciting event with your all.

  Thanks for Wuzzuf for doing all of the heavy lifting and making this a reality.
